message: الجروب فيه 16 الف ديفلوبر معظمهم من مصر فيه هنا خبرات كتير، رجاء شخصى ان
  الناس تستغل الموضوع ده فى حاجة اكبر من الأسئلة عن الكود اللى مش شغال وحابب حد يساعدك
  تصلحه و أكبر من الانترنت اللى مش شغال فى البيت عندك وأكبر من الفيجوال ستوديو اللى
  مش راضى يـcompile الابليكيشن بتاعك، ممكن تسأل الناس عن دراستهم، تدرجهم فى الشغل،
  يومهم بيكون عامل ازاي، ازاي تزود الoutput بتاعك، حاجات كتير ماينفعش تسألها غير لمجموعة
  من الديفلوبرز المصريين واللى عندهم collective experience فى المجال اكبر من انك تلاقيها
  فى أي جروب تاني.
