      id: '2020898428198432'
    message: احيانا الجروب بيقلب فعلا زى منتديات الدش والكمبيوتر وناس بتسأل فى بديهيات
      مغرقة النت وموجودة على ستاك اوفر فلو ومحلولة مليون مرة ومتجاوب عليها ملايين
      المرات للأسف حتى الناس بتكون عندها مشاكل فى الكود فى كورس ولا بيعمل برنامج وعايز
      الجروب يعملوه معاه بشكل غير مباشر فبيسأل اسئلة فى مشاكل بتواجهه هو انا نقص معلومات
      عنده زى مثلا حد مش عارف الكونسيبت بتاع array وبيحاول يسأل هى ليها بتضرب فى حين
      انه لو عمل سيرش بسيط هيعرف المشكلة فين . اللغة نفسها كإنجلش ممكن تكون عائق عند
      ناس كتير انها تفهم حل مشكلة على ستاك اوفر بس دا عائق بنسبة بسيطة جدا خصوصا كمان
      ان فيه جروبات مفتوحة للنقاشات الى من النوع دا ممكن يروحوا هناك لكن مش هنستهلك
      وقت ناس خبراتها محترمة ومستواها بروفشينال انهم يردوا على ان ال array fixed size
      مثلا او اى حاجة من النوعية دى من الأسئلة
    id: '1538680029505033'
